// import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
import './style.css';
import './images'

// const Button = ({children}) => {
//   return (
//     <button className='button'>
//       {children}
//     </button>
//   )
// }

function App() {
  const [now, setNow] = useState(new Date());

  setInterval(() => setNow(new Date()), 1000);
  return (
    <div>
    <div className="header">
        <div className="logo-wrapper">
            <img className="logo" src="./images/pngimg.com - minecraft_PNG81.png" alt="" />
        </div>

        <form action="https://javarush.com/" target="_blank"><button className="flex-item">Javarush</button></form>
        <form action="https://html5doctor.com" target="_blank"><button className="flex-item">Html5 Doktor</button></form>
        <form action="https://www.youtube.com/" target="_blank"><button className="flex-item">Youtube</button></form>
        <form action="https://frontend-stuff.com/blog/javascript-cheatsheet/" target="_blank"><button className="flex-item">JS Шпаргалка</button></form>
        <form action="https://tpverstak.ru/flex-cheatsheet/" target="_blank"><button className="flex-item">CSS Шпаргалка</button></form>
        <form action="https://chat.openai.com/auth/login" target="_blank"><button className="flex-item">Chat GPT</button></form>
    </div>

    <header className='time'>{now.toLocaleTimeString()}</header>
    <h1>Memes</h1>

    <div className="img">
        <img src="." alt="" />
        <img src="./images/Снимок экрана 2024-02-08 122019.png" alt="" />
    </div>
</div>
  );
}

export default App;
